import { motion } from 'framer-motion'

export default function Index() {
  return (
    <motion.div 
      animate={{ rotate: 360 }} 
      transition={{ duration: 1 }}
      exit={{ opacity: 0 }}
      id="home-content" 
      className="content">
        HOME
    </motion.div> 
  )
}
